% get organisms with comparative genomics
genomeAnnotation = readtable('gapfilledGenomeAnnotation.txt', 'ReadVariableNames', false, 'Delimiter', 'tab','TreatAsEmpty',['UND. -60001','UND. -2011','UND. -62011']);
genomeAnnotation = table2cell(genomeAnnotation);
orgs=unique(genomeAnnotation(:,1));

stats={'Model','DrugMetabolites','DrugReactions'};
% load all reconstructions
for i = 1:length(orgs)
    i
    load([refinedFolder filesep orgs{i} '.mat']);
    mets=strrep(model.mets,'[c]','');
    mets=unique(strrep(mets,'[e]',''));
    stats{i+1,1}=orgs{i};
    stats{i+1,2}=length(intersect(drugMetabolites,mets));
    stats{i+1,3}=length(intersect(drugReactions,model.rxns));
end
averageMets=mean(cell2mat(stats(2:end,2)));
averageRxns=mean(cell2mat(stats(2:end,3)));
